<script type="text/javascript">
  $(document).ready(function() {
    $image_crop = $("#image_demo").croppie({
      enableExif: true,
      viewport: {
        width: '100%',
        height: 400,
        type: "square" //circle
      },
      boundary: {
        width: '100%',
        height: 350
      }
    });
    $("body").on("change", "#which_one , #which_two", function() {
      var reader = new FileReader();
      var file = this.files[0];
      var fileType = file["type"];
      var validImageTypes = ["image/gif", "image/jpeg", "image/png"];
      var type = $(this).attr("data-id");
      var face = $(this).attr("data-face");
      if ($.inArray(fileType, validImageTypes) < 0) {
        // invalid file type code goes here.
        alert('Not valit Image format');
      } else {
        reader.onload = function(event) {
          $image_crop
            .croppie("bind", {
              url: event.target.result
            })
            .then(function() {
              $(".cttype").attr("data-ctid", type);
              $(".cttype").attr("data-ctface", face);
            });
        };
        reader.readAsDataURL(this.files[0]);
        $("#uploadimageModal , .fixedBackground").show();
      }
    });
    $("body").on("click", ".cttype", function(event) {
      var tct = $(this).attr("data-ctid");
      var face_prew = $(this).attr("data-ctface");
      $image_crop
        .croppie("result", {
          type: "canvas",
          size: "viewport"
        })
        .then(function(response) {
			var values = $("#whUploads").val();
          $.ajax({
            url:  requestUrl + "requests/upload.php",
            type: "POST",
            data: {
              image: response,
              t: tct,
              f: face_prew
            },
            success: function(data) {
              $("#uploadimageModal , .fixedBackground").hide();
              $("#" + face_prew).html(data);
              $("." + face_prew).hide();
               var K = $("."+tct).attr("id");
				  var T = K + "," + values;
				  if (T != "undefined,") {
					$("#whUploads").val(T);
				  } 
            }
          });
        });
    });
    // Remove Image
    $("body").on("click", ".removeThis", function() {
      var thisFace = $(this).attr("data-replace");
      $("." + thisFace).show();
      var removePrev = $(this).attr("data-rm");
      $("." + removePrev).remove();
    });
	// Close Crop
	$("body").on("click",".closeCrop", function(){
	    $("#uploadimageModal , .fixedBackground").hide();
		$(".cttype").attr("data-ctid", '');
        $(".cttype").attr("data-ctface", '');
		$("#whUploads").val(''); 
	});
  });
</script>